import React from "react";
import { View, Text, Image, S } from "react-native";

export default function FloatMenu(){
    return(
        <View>
            <Image source={require('../../assets/arrows.png')}></Image>
            <Image source={require('../../assets/money.png')}></Image>
            <Image source={require('../../assets/shop.png')}></Image>
        </View>
    )
}

const styles = StyleSheet.create()
